(1, 1, 0, 1, 1, 3, 3, 17, 'manufacturer', 'Flip-cart', 'hkdevlopers', '<p>In 2020, Flipkart Wholesale launched a digital platform for kiranas and MSMEs.[38] In July 2020, Flipkart acquired a 27% stake in Arvind Fashions Limited\'s newly formed subsidiary Arvind Youth Brands for US$35 million. Arvind Youth Brands owns the Flying Machine brand.[39] Flipkart also announced it will roll out Flipkart Quick, a hyperlocal 90-minute delivery service for product categories such as groceries, home accessories, mobile phones, stationery, and more.[40]</p>\n<p>In October 2020, Flipkart acquired a 7.8% stake in Aditya Birla Fashion and Retail for US$204 million.[41][42] The following month, Flipkart acquired the intellectual property of gaming startup Mech Mocha for an undisclosed amount.[43] The acquisition formed part of Flipkart\'s plans to gain and retain users by offering casual games.[44] In November 2020, Flipkart acquired augmented reality company Scapic, which provides a suite of tools to create and publish augmented reality, virtual reality, and 3D content quickly and without coding</p>\n<p>In 2020, Flipkart Wholesale launched a digital platform for kiranas and MSMEs.[38] In July 2020, Flipkart acquired a 27% stake in Arvind Fashions Limited\'s newly formed subsidiary Arvind Youth Brands for US$35 million. Arvind Youth Brands owns the Flying Machine brand.[39] Flipkart also announced it will roll out Flipkart Quick, a hyperlocal 90-minute delivery service for product categories such as groceries, home accessories, mobile phones, stationery, and more.[40]</p>\n<p>In October 2020, Flipkart acquired a 7.8% stake in Aditya Birla Fashion and Retail for US$204 million.[41][42] The following month, Flipkart acquired the intellectual property of gaming startup Mech Mocha for an undisclosed amount.[43] The acquisition formed part of Flipkart\'s plans to gain and retain users by offering casual games.[44] In November 2020, Flipkart acquired augmented reality company Scapic, whic