INSERT INTO `products` (`id`, `user_id`, `claimed_by`, `category_id`, `seo_id`, `is_active`, `is_featured`, `is_claimed`, `is_approved`, `name`, `slug`, `description`, `price`, `condition`, `brand`, `thumbnail`, `gallery`, `created_at`, `updated_at`) VALUES
(1, 3, 3, 2, 9, 1, 1, 0, 1, 'Acer 23.6 inch Curved Full HD VA Panel with VESA Mount Support,', 'acer-236-inch-curved-full-hd-va-panel-with-vesa-mount-support', '<p><strong>Acer 23.6 inch Curved Full HD VA Panel with VESA Mount Support, 1500R Curvature, HDMI 1.4, Integrated Speakers Gaming Monitor (ED240Q)&nbsp; (AMD Free Sync, Response Time: 1 ms, 75 Hz Refresh Rate)</strong></p><p>&nbsp;</p><p>You can have a clear view while watching shows and movies, and playing games, thanks to the Acer ED240 Desktop Monitor. Its 1920x1080p Full HD resolution delivers life-like colours so that you can enjoy every scene and game as it was meant to be viewed. Also, this monitor’s AMD FreeSync technology eliminates jitters and screen tears, letting you view without interruptions. Furthermore, the 1500R curvature of its wide FHD display allows an immersive experience while enjoying your favourite games.</p><p>&nbsp;</p><p><br></p>', '6949.00', 'new', 'Acer', 'product/thumbnail/vZx0rDBKiUXrqTxZekKbYi1DkvjKjA-metaLW9yaWdpbmFsLWltYWdnZDM4dmZ3YzZoN3Yud2VicA==-.webp', '[\"product/gallery/1grFlgIyn41aTVVsVF2314RGGKzKV7-metaLW9yaWdpbmFsLWltYWdqYWEzaGZ6ZTNuZ2Yud2VicA==-.webp\", \"product/gallery/z1ueMruxwk9qHzjyRClwif0LSIfbSw-metaLW9yaWdpbmFsLWltYWdqYWEzNXdrdnJmc3Aud2VicA==-.webp\", \"product/gallery/xGAIhbgEHQD9VnNdnvOkpxGAlzRKEJ-metaLW9yaWdpbmFsLWltYWdxZ2RmdHBoNGZmdmEud2VicA==-.webp\", \"product/gallery/bvGKgR017romDcWQUEFSwKiSiqQPEx-metaLW9yaWdpbmFsLWltYWd0bnkyajZuZzdqY2Yud2VicA==-.webp\"]', '2023-12-08 05:35:19', '2023-12-09 17:39:30'),
(2, 4, NULL, 2, 19, 1, 1, 0, 1, 'Plastic Aachar Pickle Container Chutney Mukhwas Tray Masala Tray Dining Spice Stand', 'plastic-aachar-pickle-container-chutney-mukhwas-tray-masala-tray-dining-spice-stand', '<p>In 2020, Flipkart Wholesale launched a digital platform for kiranas and MSMEs.[38] In July 2020, Flipkart acquired a 27% stake in Arvind Fashions Limited\'s newly formed subsidiary Arvind Youth Brands for US$35 million. Arvind Youth Brands owns the Flying Machine brand.[39] Flipkart also announced it will roll out Flipkart Quick, a hyperlocal 90-minute delivery service for product categories such as groceries, home accessories, mobile phones, stationery, and more.[40]</p>\n<p>&nbsp;</p>', '0.00', 'new', 'Brand', 'product/thumbnail/UZxJSAr9Dq3gnHiEi5Xm3tmylVRFqI-metaMS53ZWJw-.webp', '[\"product/gallery/43ZsPNsiQcAQBRg4UmXTtxzAV1VCT3-metaMi53ZWJw-.webp\", \"product/gallery/U61KaSdRFVGSrpO1mwKZ0nFyu3R5TH-metaMy53ZWJw-.webp\", \"product/gallery/uBggEjrFe2vz3cdtTssoqirq4ODdw3-metaNC53ZWJw-.webp\"]', '2023-12-09 15:54:24', '2023-12-09 17:39:40'),
(3, 4, NULL, 2, 20, 1, 1, 0, 1, 'Brass Mukhwas Set Rava, Packaging Type: Box', 'brass-mukhwas-set-rava-packaging-type-box', '<p>Brass Mukhwas Set Rava, Packaging Type: Box</p>\n<p><br>We are among the leading manufacturers and suppliers of superior quality Mukhwas Set Rawa, which are available in beautiful designing patterns. Widely used for gifting purpose, these products are appropriate for the safe storage of the dry fruits and other related items. Our team of diligent workers makes use of modernized manufacturing equipments in rendering quality assured product range in the market. These products are widely available in the market at reasonable rates and are timely delivered within set time constraints.</p>', NULL, 'new', NULL, 'product/thumbnail/SWHk68qeXcsLoOlVBBuEzV361YXcu3-metaMS53ZWJw-.webp', '[\"product/gallery/e7ipN2xPaD8CxXsK6NB2T0rCnvfHNM-metaMS53ZWJw-.webp\"]', '2023-12-09 15:58:49', '2023-12-09 17:39:50'),
(4, 4, NULL, 2, 21, 1, 1, 0, 1, 'Antique Arti Deep', 'antique-arti-deep', '<p>We are instrumental in providing our clients with a perfect quality Antique Arti Deep. This arti deep is used in prayer halls or in temples to offer arti to the gods and goddesses.</p>\n<p>&nbsp;</p>\n<p>The offered product is highly demanded and appreciated by our clients for its long-lasting shine and glossy finish. In order to ensure flawlessness in our deliveries, the offered product is checked against various quality parameters. Clients can avail this range of from us at market leading prices.</p>', NULL, 'new', NULL, 'product/thumbnail/GL0m44pHtHM9yS581e368yDrY8PPaa-metaMS53ZWJw-.webp', '[\"product/gallery/XxTuKTBesfU6CTvlZ3rzs5oKhCEP0f-metaMS53ZWJw-.webp\", \"product/gallery/sdEXBN2lX6HPbEe8HIdQOzf2ZAaT5o-metaMi53ZWJw-.webp\", \"product/gallery/x3qToVbLdiQG1oIPN0cRpyy9beXkFa-metaMy53ZWJw-.webp\"]', '2023-12-09 16:01:30', '2023-12-09 17:41:36'),
(5, 4, 4, 3, 22, 1, 0, 0, 1, 'vgjgughgjhgu', '56456465', '<p>Our respectable clients can avail from us, a pristine array of Akhand Deep. This akhand deep is designed by our professionals from optimum quality brass, in complete compliance with international quality standards. In order to cater varied demands of clients, the offered product can also be customized in different designs, sizes and other related specifications. To ensure that only flawless product is dispatched from our end, our range is rigorously tested on various quality parameters.</p>', '12.00', 'new', 'abc', 'product/thumbnail/uO9k4fXeWAKni0UL4PlhblteRbrWbr-metaMS53ZWJw-.webp', '[\"product/gallery/jaZkUAitJqovoc2uTEPUqaX8Ijs3Ry-metaMS53ZWJw-.webp\", \"product/gallery/0zwTNPtv1rApd2qLKzTjgXqJbfyQqp-metaMi53ZWJw-.webp\", \"product/gallery/sgDm7uPVQcReFjvZoLOA5iA5u3Ubsn-metaMy53ZWJw-.webp\"]', '2023-12-09 16:04:12', '2023-12-09 18:19:15');
